import { useCart } from "./context/CartContext";

export default function Checkout() {
  const { cart, totalAmount } = useCart();

  const handlePay = async (e) => {
    e.preventDefault();
    // ... insert your existing Razorpay logic here ...
    alert("This connects to your backend paymentRoutes.js!");
  };

  return (
    <div className="container" style={styles.wrap}>
      {/* LEFT: FORM */}
      <div style={styles.left}>
        <h2 style={{fontFamily: 'var(--font-heading)', marginBottom: 30}}>Checkout</h2>
        <form onSubmit={handlePay} style={styles.form}>
          <input type="email" placeholder="Email" style={styles.input} required />

          <div style={styles.row}>
            <input type="text" placeholder="First Name" style={styles.input} required />
            <input type="text" placeholder="Last Name" style={styles.input} required />
          </div>

          <input type="text" placeholder="Address" style={styles.input} required />
          <input type="text" placeholder="Apartment, suite, etc." style={styles.input} />

          <div style={styles.row}>
            <input type="text" placeholder="City" style={styles.input} required />
            <input type="text" placeholder="PIN Code" style={styles.input} required />
          </div>

          <button type="submit" className="btn-primary" style={{marginTop: 20}}>
            PAY ₹{totalAmount}
          </button>
        </form>
      </div>

      {/* RIGHT: SUMMARY */}
      <div style={styles.right}>
        <div style={styles.summaryBox}>
          {cart.map((p, i) => (
            <div key={i} style={styles.item}>
              <div style={{display:'flex', gap:10}}>
                <div style={styles.imgBadge}>
                  <img src={p.img || "https://via.placeholder.com/50"} style={{width:'100%', height:'100%', borderRadius: 5}} />
                  <span style={styles.qtyBadge}>1</span>
                </div>
                <span>{p.name}</span>
              </div>
              <span>₹{p.price}</span>
            </div>
          ))}
          <div style={styles.divider}></div>
          <div style={styles.totalRow}>
            <span>Total</span>
            <span style={{fontSize: 20}}>₹{totalAmount}</span>
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  wrap: { display: "grid", gridTemplateColumns: "1.5fr 1fr", gap: "60px", padding: "60px 20px" },
  form: { display: "flex", flexDirection: "column", gap: "15px" },
  row: { display: "grid", gridTemplateColumns: "1fr 1fr", gap: "15px" },
  input: { padding: "14px", border: "1px solid #d9d9d9", borderRadius: "5px", fontSize: "14px" },
  right: { background: "#fafafa", padding: "40px", borderRadius: "8px" },
  item: { display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "15px", fontSize: "14px" },
  imgBadge: { width: 50, height: 50, position: 'relative', border: '1px solid #e2e2e2', borderRadius: 5 },
  qtyBadge: { position: 'absolute', top: -8, right: -8, background: '#666', color: '#fff', borderRadius: '50%', width: 18, height: 18, fontSize: 11, display:'flex', alignItems:'center', justifyContent:'center' },
  divider: { height: 1, background: '#e2e2e2', margin: '20px 0' },
  totalRow: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', fontWeight: 'bold' }
};
